import React from 'react';
import { createUseStyles } from 'react-jss';

const useStyles = createUseStyles({
	overlay: {
		position: 'absolute',
		bottom: '0',
		background: 'rgba(0, 0, 0, 0.5)',
		color: 'white',
		width: '100%',
		transition: '.5s ease',
		opacity: '0',
		fontSize: '20px',
		padding: '20px',
		textAlign: 'center',
		'&:hover': {
			opacity: 1,
		},
	},
});

const Overlay = ({ imageMetaData }) => {
	console.log(imageMetaData);
	const classes = useStyles();
	return (
		<div className={classes.overlay}>
			<p>{imageMetaData.user.name}</p>
			<p>{imageMetaData.created_at}</p>
            <p>{imageMetaData.alt_description}</p>
            <p>{imageMetaData.location}</p>
		</div>
	);
};

export default Overlay;
